import NavStory from './NavStory';
import TextBox from './TextBox';
import ViewStories from './ViewStories';
import appCSS from './app.css';


function App() {
  return (
    <div>
      {/* <NavStory /> 
      <ViewStories />
      <TextBox /> */}

      <img src="./images/The_Refuge.jpg" id = "Green_Lake" width = "150" alt = "Green Lake"/>
      <img src = "./images/Ghibili_House.jpg" id = "Ghibili_House" height = "100"  alt = "Ghibili_House"></img>
      <img  name = "The Unfinished Carosel Path" id = "Carosel_Path" height = "100"  alt = "Unfinished_Carosel_Path"></img>
   </div>
  );
}

export default App;
